RequestPinV35Rs:
  type: object
  properties:
    keyValues:
      type: array
      items:
        $ref: aggregate.yaml#/KeyValueDataV35
    pin:
      type: string
      description: <p> This field contains the current <b>PIN</b>. It is encrypted
        and formatted as a block of 16 hexadecimal digits. The PIN Block is transmitted
        encrypted under the <b>ZPK (Zone PIN key)</b>. This key should be shared between
        PowerCARD and the other party. This field is reserved for future use. </p>
    pinBlockFormat:
      type: string
      enum:
        - '01'
        - '03'
      description: <p> PIN Block Format ,this field indicates the format of the PIN
        block,select one valid value from the list.<br> <b>01</b> - Format is based
        on the PIN, the PIN length, the selected rightmost digits of the account number,
        and the pad characters 0 and F—combined through an exclusive OR operation.<br>
        <b>03</b> - Format is based on the PIN and the F pad character. </p>
    responseInfo:
      type: object
      $ref: aggregate.yaml#/ResponseInfo
